import sys
import subprocess

def bf_run(code, input):
    p = subprocess.Popen(["bf", "-"], stdin=subprocess.PIPE, stdout=subprocess.PIPE, universal_newlines=True)
    p.stdin.write(code)
    p.stdin.write(f"{input}\n")
    p.stdin.close()
    return p.stdout.read()

